import React, { useState } from 'react';
import Modal from 'react-modal';

import {
Nav,
NavLink,
Bars,
NavMenu,
NavBtn,
NavBtnLink,
} from './NavbarElement';

const Navbar = () => {
	const [isModalOpen, setModalOpen] = useState(false);
	const openModal = () => {
		setModalOpen(true);
	  };
	  const closeModal = () => {
		setModalOpen(false);
	  };
			

return (
	<>
	<Nav>
		<Bars />

		<NavMenu>
		<NavLink to='/home' activeStyle>
			Home
		</NavLink>
		<NavLink to='/about' activeStyle>
			About
		</NavLink>
		<NavLink to='/events' activeStyle>
			Events
		</NavLink>		
		<NavLink to='/games' activeStyle>
			Games
		</NavLink>
		<NavLink to='/signup' activeStyle>
			Sign Up
		</NavLink>
		{/* Second Nav */}
		{/* <NavBtnLink to='/sign-in'>Sign In</NavBtnLink> */}
		</NavMenu>
		<NavBtn>
		<NavBtnLink onClick={openModal}>Sign In</NavBtnLink>
		</NavBtn>
	</Nav>
	<Modal
  isOpen={isModalOpen}
  onRequestClose={closeModal}
  contentLabel="Sign In Modal"
>
  {/* Sadr≈æaj modalnog prozora za prijavu/registraciju */}
  {/* Dodajte elemente i logiku za prijavu/registraciju */}
</Modal>

	</>
);
};

export default Navbar;
